REPLACE INTO askapp.askapp_tag (id, name, slug) VALUES (3, 'FunFact', 'funfact');REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (1, 0, 0, null, 0, '2020-10-18 18:49:39.287907', '2020-10-18 18:49:39.287950', 'DD', 'Here''s a photo of a web sloth. Because why not. You can use AskApp for any content.', 'Wet Sloth', 'uploads/images/2020/10/18/wet_sloth.jpg', 0, 5, null, '', 0, null, null);
REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (2, 0, 0, null, 0, '2020-10-18 18:53:09.540153', '2020-10-18 18:53:09.540200', 'YT', 'There is a YouTube video type of document in AskApp. You can just paste the YouTube URL and click "Preload" button and it will pull the video''s description from youtube that you can later modify.', 'PSY - GANGNAM STYLE', 'uploads/images/2020/10/18/9bZkp7q19f0.jpg', 0, 5, 'https://www.youtube.com/watch?v=9bZkp7q19f0', '', 0, null, null);
REPLACE INTO askapp.askapp_post (id, created, parent_id, text, is_answer, thread_id, user_id, level, lft, rght, tree_id, deleted, accepted) VALUES (1, '2020-10-18 19:22:21.452923', null, 'Thanks for your interest in AskApp. We also believe that it is a nice content management tool. Unfortunately we haven''t written a comprehensive documentation where you can learn about everything AskApp can do. But this is how Open Source works - if you see something is missing in a repository, feel free to contribute. If you are not interested in writing the doc yourself, you can post an issue in the repository. That way we''ll know what exactly you need and we''ll do our best to help. Isues motivate us to move forward.', 0, 6, 1, 0, 1, 4, 1, 0, null);
REPLACE INTO askapp.askapp_post (id, created, parent_id, text, is_answer, thread_id, user_id, level, lft, rght, tree_id, deleted, accepted) VALUES (2, '2020-10-18 19:28:51.228877', 1, 'This is nice to hear, I will check out AskApp repository and see how I could contribute!', 0, 6, 4, 1, 2, 3, 1, 0, null);
REPLACE INTO askapp.askapp_post (id, created, parent_id, text, is_answer, thread_id, user_id, level, lft, rght, tree_id, deleted, accepted) VALUES (3, '2020-10-18 20:58:01.809000', null, 'Why is this article highlighted?', 0, 3, 1, 0, 1, 4, 2, 0, null);
REPLACE INTO askapp.askapp_post (id, created, parent_id, text, is_answer, thread_id, user_id, level, lft, rght, tree_id, deleted, accepted) VALUES (4, '2020-10-18 20:59:16.800263', 3, 'I am glad you have asked! In the admin panel you can choose to make any document sticky. It will make the document appear at the top of the feed for the duration of time you chose for it to be sticky. You can program the document to be sticky for any duration. Once the period expired, the document will return to being normal.', 0, 3, 4, 1, 2, 3, 2, 0, null);
REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (3, 0, 0, '2021-10-26', 0, '2020-10-18 18:54:19.988537', '2020-10-18 20:57:27.421241', 'DD', 'The main feature of AskApp is content curation. Much like HackerNews or Reddit, the articles posted here are displayed in a chronological order and the top page features the most upvoted articles with the priority given to more recent posts.', 'What is AskApp About?', '', 2, 4, null, '', 0, null, null);
REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (4, 0, 0, null, 0, '2020-10-18 19:10:08.782238', '2020-10-18 20:54:48.837363', 'LL', 'It is a showcase website for AspApp. It collects and curates articles about Japan. You can find all types of documents - Links, Discussions, YouTube videos.', 'Akihabara.Tokyo', 'uploads/images/2020/10/18/largelogo_6l3yibd.jpg', 1, 4, 'https://akihabara.tokyo', '', 0, 'akihabara.tokyo', null);
REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (5, 0, 0, null, 1, '2020-10-18 19:21:10.659009', '2020-10-18 19:24:43.658746', 'DD', 'This is an example of a featured document. It doesn''t matter what type it is, it can be a Link, a Discussion or a YouTube video. The point of being featured is that it will appear in the feed  highlighted. Unlike a Sticky document, it will not remain at the top of the feed, but will be pushed down in the Recent feed as new documents are added. It may or may not get featured on the Top page  depending on the number of upvotes it gets, just like any other document.', 'This is a Featured Document', '', 0, 3, null, '', 0, null, null);
REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (6, 0, 0, null, 0, '2020-10-18 19:21:52.418147', '2020-10-18 19:21:52.418182', 'DD', 'AskApp looks cool and I would be interested in using it, but I can''t seem to find complete documentation. I wish there was a place where I could read about all the features.', 'I wish there was a more complete documentation', '', 0, 3, null, '', 0, null, null);
REPLACE INTO askapp.askapp_thread (id, hidden, closed, sticky, featured, created, modified, thread_type, text, title, image, score, user_id, link, thumbnail, deleted, domain, original_id) VALUES (7, 0, 0, null, 0, '2020-10-18 19:36:43.119561', '2020-10-18 19:36:43.119597', 'LL', 'AskApp is the content curation and community building system. It is simple, yet flexible. If you are reading this you have already cloned the code from the repository and even managed to run the dockerezed version locally. Great job!', 'Here''s AskApp code repository', '', 0, 1, 'https://github.com/BanzaiTokyo/askapp', '', 0, 'github.com', null);REPLACE INTO askapp.askapp_thread_tags (id, thread_id, tag_id) VALUES (1, 1, 3);
